INSERT INTO `listing_templates` (`id`, `title`, `template`, `slug`, `flag`) VALUES
(1, 'Default Template', '<html>\r\n\r\n<link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Open+Sans:300,600">\r\n<meta http-equiv="content-type" content="text/html; charset=UTF-8">\r\n\r\n<style>\r\n\r\nbody {\r\n  /*padding: 20px 80px 20px 20px;*/\r\n  font-family: "Source Sans Pro", sans-serif;\r\n}\r\n\r\nh2 {\r\n  margin-top: 0;\r\n}\r\n\r\n.images img {\r\n  max-width: 400px;\r\n}\r\n\r\n.store_desc {\r\n  min-width: 800px;\r\n  text-align: center;\r\n  border-top: 1px solid #333;\r\n  border-bottom: 1px solid #333;\r\n  background-color: #D9F0FF;\r\n  margin: 40px 0 20px\r\n}\r\n\r\n.third {\r\n  width: 30%;\r\n  display: inline-block;\r\n  padding: 10px 1.5% 10px;\r\n  margin: 40px 0 40px;\r\n  text-align: center;\r\n}\r\n\r\n.tt {\r\n  font-size: 1.4em;\r\n  padding-bottom: 10px;\r\n}\r\n\r\n.col_left {\r\n  position: absolute;\r\n}\r\n\r\n.col_right {\r\n  margin-left: 400px;\r\n  min-height: 520px;\r\n  min-width: 400px;\r\n}\r\n\r\n.images img {\r\n  max-height: 520px;\r\n  max-width: 380px;\r\n}\r\n\r\n</style>\r\n\r\n<h1>{{title}}</h1>\r\n\r\n<hr>\r\n<br>\r\n\r\n<div class="two_col minwidth">\r\n\r\n <!-- Zinc EPID: {{asin}} -->\r\n <!-- PyN -->\r\n\r\n  <div class="col col_left">\r\n    <div class="images">\r\n      <img src={{main_image}}>\r\n    </div>\r\n  </div>\r\n\r\n  <div class="col col_right">\r\n    <div class="description">\r\n      <h2>Product Details</h2>\r\n      <h3>\r\n        {{variant_specifics}}\r\n      </h3>\r\n      <ul>\r\n        {{product_details}}\r\n      </ul>\r\n      <ul>\r\n        {{feature_bullets}}          \r\n      </ul>\r\n      <p>\r\n        {{post_description}}\r\n      </p>\r\n      <p>\r\n        {{{product_description}}}\r\n      </p>\r\n    </div>\r\n  </div>\r\n\r\n</div>\r\n\r\n</html>\r\n', 'default', 1),
(2, 'Alternative Template', '<html>\r\n<style>\r\n\r\n\r\nbody {\r\n    color: black !important;\r\n}\r\n\r\nhtml {\r\n    color: black;\r\n}\r\n\r\nh3 {\r\n    color: black;\r\n}\r\n\r\np {\r\n    color: #000000;\r\n    margin: 0;\r\n	padding: 0;\r\n}\r\n\r\n\r\n.a {\r\n    list-style-type: circle;\r\n    margin-left: 10px;\r\n    padding-left: 10px;\r\n}\r\n\r\nh2 {\r\n	color: #000000;\r\n    margin: 0;\r\n	padding: 0;\r\n}\r\n\r\ndiv {\r\n	margin: 0;\r\n	padding: 0;\r\n}\r\n\r\n#content{\r\n	margin: 0;\r\n	padding: 0;\r\n}\r\n\r\n</style>\r\n\r\n\r\n<link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Open+Sans:300,600">\r\n<meta http-equiv="content-type" content="text/html; charset=UTF-8">\r\n\r\n\r\n<meta http-equiv="content-type" content="text/html; charset=UTF-8">\r\n\r\n<h3>{{title}}</h3>\r\n<p id="b">{{{product_description}}}</p> \r\n\r\n<h3>Product Features</h3>\r\n  <ul class="a">\r\n        {{feature_bullets}}\r\n  </ul>\r\n\r\n<br><br><br><hr> \r\n<h3>Shipping:</h3> \r\n\r\n<p>Shipping is complimentary within the lower 48 US States.</p> \r\n<ul class="a"> \r\n	<li>We Do Not Ship to PO/APO Boxes, HI or Alaska</li> \r\n	<li>We Do Not Ship Outside of the Continental US</li> \r\n	<li>All items ship within 24-72 hours of Payment</li> \r\n	<li>For large items that require Freight shipping a valid phone number is required to call and schedule your delivery</li> \r\n</ul> \r\n\r\n<br> \r\n<h3>Terms of Sale and Feedback:</h3> \r\n<ul class="a">	\r\n	<li>Feedback is extremely important to us and eBay</li> \r\n	<li>If you are satisfied with our transaction, please take a moment to leave Positive Feedback. YOUR Satisfaction is our #1 Priority!</li> \r\n	<li>If there are any issues, PLEASE contact us BEFORE leaving a neutral or negative rating so that we may resolve any concerns.</li> \r\n	<li>We PROMISE we can make you happy if you give us a fair chance.</li> \r\n</ul> <br> \r\n\r\n<h3>Returns / Concerns:</h3> \r\n\r\n<ul class="a"> \r\n	<li>All items qualify for returns within 14 - 30 days of receipt. Buyer is responsible for return shipping on any item that is not damaged</li> \r\n	<li>Please be sure this is an item you want before making your purchase. Customer Satisfaction is our TOP priority!</li> \r\n	<li>All items are IN STOCK at time of listing.</li> \r\n	<li>Inventory on eBay changes constantly and it is impossible to maintain a perfectly accurate count of all items.</li> \r\n	<li>Please do not penalize us if we have to issue you a refund!</li> \r\n</ul> \r\n\r\n<br> <br>\r\n<h1 align="center">Thank You For Your Business!</h1> <!-- Zinc EPID: {{asin}} -->\r\n\r\n</html>\r\n\r\n\r\n', 'alternative', 0),
(3, 'Modern Template', '<meta charset="utf-8">\r\n<meta http-equiv="X-UA-Compatible" content="IE=edge">\r\n<meta name="viewport" content="width=device-width, initial-scale=1">\r\n<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.4/css/bootstrap.min.css">\r\n\r\n<div class="container">\r\n  <h1>{{title}}</h1>\r\n  <img src={{main_image}} style="max-width: 512px;">\r\n  <h3><span class="glyphicon glyphicon-list-alt"></span> Description</h3>\r\n  <p>{{{product_description}}}</p>\r\n  <p>Features:</p>\r\n  <ul>\r\n    {{feature_bullets}}\r\n  </ul>\r\n\r\n  <p>Product Details:</p>\r\n  <ul>\r\n    {{product_details}}\r\n  </ul>\r\n\r\n  <ul class="list-unstyled">\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-time"></span> Handling</h3>\r\n      <p>We will ship all orders within <mark>3 business day</mark> of payment.</p>\r\n    </li>\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-send"></span> Delivery</h3>\r\n      We Do Not Ship Outside of the Continental US.\r\n    </li>\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-ok-circle"></span> Return Policy</h3>\r\n      All items qualify for returns within 30 days of receipt. Buyer is responsible for return shipping on any item that is not damaged.\r\n    </li>\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-comment"></span> Feedback</h3>\r\n      <p>We take our reputation seriously, we buy and sell online, so we understand the value of trust. <mark>If you are unsatisfied with your order, please contact us</mark> and we will work with you to resolve it to your satisfaction.</p>\r\n    </li>\r\n  </ul>\r\n</div>\r\n', 'modern', 0);

