mages/I/31YB9aSOAjL.jpg","Height":"500","Width":"500"},"HiResImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41j3eSvMWBL.jpg","Height":"1000","Width":"1000"}},{"@attributes":{"Category":"primary"},"SwatchImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41KBrGlnOEL._SL30_.jpg","Height":"30","Width":"30"},"SmallImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41KBrGlnOEL._SL75_.jpg","Height":"75","Width":"75"},"ThumbnailImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41KBrGlnOEL._SL75_.jpg","Height":"75","Width":"75"},"TinyImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41KBrGlnOEL._SL110_.jpg","Height":"110","Width":"110"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41KBrGlnOEL._SL160_.jpg","Height":"160","Width":"160"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41KBrGlnOEL.jpg","Height":"500","Width":"500"}}]', 'Electronics', 'Sennheiser', '{"Brand":"Sennheiser","Model":"OCX 686i","MPN":"OCX 686i"}', 'Black & Green', '["Inline smart remote and mic on the cable are compatible with Apple devices","Sealed in-ear-canal design for improved blocking of outside noise","Earhook structure to minimize structure borne noise","Para-aramid-reinforced cable provides superior strength and reliability","Oval-shaped cable ensures a tangle-free listening experience and reduced cable noise"]', '{"Height":"472","Length":"551","Weight":"51","Width":"169"}', 'GBP', '3999', '7999', NULL, '4000', 'OCX 686i', 'CE', NULL, 'Take your workout sessions to the next level with the Sennheiser OCX 686i sports headphones. Their adjustable ear hook will provide you with comfortable fit and make sure the headphones stay securely in place allowing for unrestricted movement. This lightweight headset features high-output drivers to ensure superb sound quality, and its unique sealed in-ear canal design blocks out background noise. Tangle-free listening experience is guaranteed by the para-aramid-reinforced asymmetrical cable. These sweat and water resistant headphones feature SteriTouch antimicrobial ear adapters ideal for intense training sessions. The Sennheiser OCX 686i comes with a convenient storage pouch, ear adapter set and a cable clip.', '', '', '', NULL, 'Review and List', 0, NULL, NULL, NULL, 0, 0, '2017-10-03 14:51:51', '2017-10-03 14:51:51'),
