 with external battery of 2600mAh capacity for your iPhone 7.","ULTRA SLIM POWER CHARGER CASE- Ultra Slim Battery Backup Case. Comfortable design with an outstanding feeling of touch, which can be easily carried in any pocket and that will completely protect your iPhone 7 from impacts, shock, scratches and daily wear.","BATTERY CASE WITH LED-lighting to indicate the battery charge status of the power case and a built-in power button.","PROTECTIVE BATTERY CHARGER CASE, Measures: 142 x 71 x 13 mm. Weight 65,5 gr.","THIS BATTERY COVER CASE IS FCC, CE and RoHS- certified, guaranteeing therefore the use for iPhone 7. NOTICE: This Battery Case is only compatible with bluetooth headsets."]', NULL, 'GBP', '2850', '8300', '2850', '5450', 'CM - IP7', 'CE', NULL, '<b>CAMEL CHARGER</b> presents its new Ultra Slim charger case, the world\'s best battery case. Thanks to its ultra-thin design, and a weight of only 65,5 gr, you\'ll forget that it\'s even in your pocket or hand. <br> Features a charger battery of a capacity of 2600mAh for your iPhone 7. Besides charging your Apple smartphone, it protects it from shocks, impacts, scratches and daily wear. Includes a power bottom and Led light that indicate the charging status of your battery charger case. <br> The CAMEL CHARGER Ultra Slim Power bank case is FCC, CE and RoHS- certified, guaranteeing therefore the use for iPhone 7. <br> <b>CAMEL CHARGER</b> is an American company, which is exclusively specialized in Premium accessories for Apple cell phones. The cover case has been designed in California, (USA).', '', '', '', NULL, 'Review and List', 0, NULL, NULL, NULL, 0, 0, '2017-10-04 13:38:53', '2017-10-04 13:38:53'),
