TY Hype backpacks - School, work or gym bags for boys, girls, women and men of all ages - Black Blue Speckle","Black Hype Bag with Blue Paint Speckle - 18L Capacity backpack - VERY SPACIOUS with 2 zip compartments including small front pouch","This Ideal School Bag has ADJUSTABLE SHOULDER STRAPS for complete flexibility and comfort","HYPE CREST EMBROIDERED LOGO - Official Just Hype UK Seller so all GENUINE BAGS with Tags","These rucksacks SELL OUT FAST so BUY NOW to avoid missing out"]', '{"Height":"1732","Length":"197","Width":"1496"}', 'GBP', '2999', NULL, NULL, NULL, 'Hype bag (Splatter) Black / Blue', 'Luggage', NULL, 'This very popular Black Blue Speckle Hype Backpack is the bag of choice at the moment. One of the top brands available with brilliant and unique designs. Made from 100% polyester the bag is light weight, strong and wipe clean. It has plenty of room in 2 zipped compartments. Total capacity is 18L and dimensions when full of 40 x 30 x 12cm with the addition of a smaller front pocket to look after your smaller or more fragile items. Adjustable shoulder straps allow for a great fit, perfect schoolbags for boys and girls. With a range of designs and colours there is a style for everyone. Hype bags sell out very fast so get yours now and one for your family or friends so they do not miss out. When you receive your backpack, please let us know what you think of it and also if you would like us to stock any other colours. Have a great day and we hope you enjoy your new bag.', '', '', '', NULL, 'Review and List', 1, '110226441986', NULL, 30.30, 0, 0, '2017-10-05 14:41:25', '2017-10-05 14:41:25'),
