d to expand. Throughout the \'30s and \'40s Lee continued to build on their brand, becoming the nation\'s #1 manufacturer of work clothes. Within last 122 years Lee put itself as one oft he most successful brands in the world. Lee is a high-quality brand for real people who stay for their choice: Blake, Daren and Powell for men and Marlin, Jade and Scarlett for women are an absolute must have. What is so special about LeeÂ®? It has not only a wide range of designs but also cuts: from skinny and slim fit including regular till relaxed fit. Today Lee expanded its presence in more than 100 countries worldwide and brings more fits, styles, finishes, features and choices than ever before to market.. At Brand-Catcher you\'ll find a best choice of Lee Jeans.</p><br/><br/><b>color nuance:</b> dark <br/><b>clasp:</b> Zip Fly <br/><b>rise:</b> normal <br/><b>Fitting:</b> Regular<br/><b>Fitting:</b> Regular<br/><b>Material:</b> 100% cotton<br/><b>Fit:</b> normal<br/><b>cut:</b> Relaxed / Loose , Regular <br/><b>washing:</b> easy wash <br/><b>Care Instructions:</b> Please note label, machine wash at 40Â°C <br/>', '{"Size":["30W x 30L","W30/L30","30W x 32L","W30/L32","30W x 34L","W30/L34","W32/L30","32W x 32L","W32/L32","W32/L34","33W x 30L","W34/L30","W34/L32","34W x 34L","W34/L34","W36/L30","W36/L32","36W x 34L","W36/L34","38W x 30L","W38/L30","38W x 32L","W38/L32","W38/L34","40W x 30L","W40/L30","40W x 32L","W40/L32","W40/L34","42W x 32L","W42/L32","42W x 34L","W42/L34","W44/L32 (Manufacturer Size: W44/L32)"],"Color":["Blue (SUPER STONEWASH)","Black (Black Rinse)","Blau (ONE WASH 45)","Blue (Stonewash)","Taupe"]}', '[{"sku":"UK7B00BC0ABVK","qty":5,"price":"3999","attrs":[{"Name":"Size","Value":"30W x 30L"},{"Name":"Color","Value":"Blue (SUPER STONEWASH)"}]},{"sku":"UK7B001UELVQC","qty":5,"price":"3999","attrs":[{"Name":"Size","Value":"W30/L30"},{"Name":"Color","Value":"Black (Black Rinse)"}]},{"sku":"UK7B00BC095DU","qty":5,"price":"3000","attrs":[{"Name":"Size","Value":"W30/L