or and plays silly sounds,Turning the elephant\'s trunk and ears makes fun mechanical sounds and builds fine motor skills; Soft ears perfect for teething and soothing sore gums,Baby musical toys promotes fun and learning; The elephant rattle\'s light-up button flashes and plays 25+ songs, melodies, sounds and phrases,Textured black and white handle is perfect for little hands and the bead rings spin and slide; Connects to the VTech Pack-O-Links (sold separately),Requires 1 AAA battery (battery included for demo purposes only; new battery recommended for regular use); intended for ages 3 months to 3 years"}', 'White', '["The Shake and Sing Elephant rattle is great for engaging your little one; Shaking the baby rattle activates the motion sensor and plays silly sounds","Turning the elephant\'s trunk and ears makes fun mechanical sounds and builds fine motor skills; Soft ears perfect for teething and soothing sore gums","Baby musical toys promotes fun and learning; The elephant rattle\'s light-up button flashes and plays 25+ songs, melodies, sounds and phrases","Textured black and white handle is perfect for little hands and the bead rings spin and slide; Connects to the VTech Pack-O-Links (sold separately)","Requires 1 AAA battery (battery included for demo purposes only; new battery recommended for regular use); intended for ages 3 months to 3 years"]', '{"Height":"709","Length":"248","Weight":"34","Width":"614"}', 'USD', '796', '1295', NULL, '499', '80-184800', 'Toy', '90 day warranty against manufacturer defects', 'VTech baby rattles are great baby toys and baby gifts. Your child will love rattling the Shake and Sing Elephant Rattle by VTech. Press the adorable elephant\'s light-up button and it will play melodies, songs and fun phrases. Little ones will also build fine motor skills by turning the elephant\'s trunk and his soft, textured ears, which are perfect for teething. When they grasp the black and white textured handle and shake the rattle, they will activate the motion sensor and be rewarded with a variety of silly sounds. Shake and play with the elephant! The baby rattle is intended for babies ages 3 months to 3 years. The interactive rattle requires 1 AAA battery (battery included for demo purposes only; new battery recommended for regular use).', NULL, NULL, NULL, NULL, 'Review and List', 1, '110231408014', 175691, 8.16, 0, 0, '2017-10-30 17:50:30', '2017-10-30 17:50:30'),
