sky","Sweet fruit and Oloroso sherry notes, layered with honey and vanilla","Smooth and mellow with beautifully combined flavours","Long and warming finish"]', '{"Height":"1039","Length":"382","Weight":"220","Width":"382"}', 'GBP', '3700', '4550', NULL, '850', '101537296', 'Grocery', NULL, 'The Balvenie Doublewood Single Malt Scotch Whisky is a 12 year old single malt which gains its distinctive character from being matured in two woods.<br><br>During its period of maturation The Balvenie Doublewood is transferred from a traditional oak whisky cask to a first fill Spanish oak sherry cask. Each stage lends different qualities to the resulting single malt - the traditional casks, having previously held bourbon, soften and add character, whilst the sherry wood brings depth and fullness of flavour.<br><br>The nose is Sweet fruit and oloroso sherry notes, layered with honey and vanilla.<br><br>The taste is a smooth and mellow single malt of beautifully combined flavours - nutty sweetness, cinnamon spiciness and a delicately proportioned layer of sherry - with a long and warming finish.', NULL, NULL, NULL, NULL, 'Review and List', 1, '110232026015', 8391, 37.38, 0, 0, '2017-11-02 10:40:36', '2017-11-02 10:59:32'),
